const query=getUrlParameter("q");const filter=query.toUpperCase();const list=document.getElementById("results");const listItems=list.getElementsByTagName("a");document.getElementById("results-for").innerHTML=query;for(i=0;i<listItems.length;i++){if(listItems[i].innerHTML.toUpperCase().indexOf(filter)>-1){listItems[i].style.display=""}else{listItems[i].style.display="none"}}function getUrlParameter(a){a=a.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var c=new RegExp("[\\?&]"+a+"=([^&#]*)");var b=c.exec(location.search);return b===null?"":decodeURIComponent(b[1].replace(/\+/g," "))};